import React from 'react';
import './App.css';
const Header = React.lazy(() => import('./Header'));
const Banner = React.lazy(() => import('./Banner'));
const MenuName = React.lazy(() => import('./MenuName'));
const MenuImgs = React.lazy(() => import('./MenuImgs'));

function App() {
  return (
    <div className="App">
      <section>
        <Header/>
      </section>
      <section>
        <Banner/>
      </section>
      <section>
        <MenuName/>
      </section>
      <section>
        <MenuImgs/>
      </section>


    </div>
  );
}

export default App;
